import Head from "next/head";

export default () => (
  <div>
    <Head>
      <meta name="viewport" content="width=device-width, initial-scale=1" />
      <link
        href="https://fonts.googleapis.com/css?family=Open+Sans|Roboto:300,400,700,900"
        rel="stylesheet"
      />
    </Head>
    <style jsx global>{`
      body {
        margin: 0;
      }
      #__next {
        height: 100vh;
        display: flex;
        flex-direction: column;
        color: #b7ddf4;
        font-family: "Roboto", sans-serif;
        background: rgba(16, 32, 48, 0.7);
      }

      header {
        background: #102030;
        -webkit-box-shadow: 0px 1px 16px -2px rgba(0, 0, 0, 0.65);
        -moz-box-shadow: 0px 1px 16px -2px rgba(0, 0, 0, 0.65);
        box-shadow: 0px 1px 16px -2px rgba(0, 0, 0, 0.65);
      }
    `}</style>
  </div>
);
